import React, {Component} from 'react';
import './App.css';
import { Button } from 'element-react';
import 'element-theme-default';

class App extends Component {
    render() {
        return (
            <div className="App">
              <Button type="primary">Hello</Button>
            </div>
        );
    }

}

export default App;
